        "title": {
            "rendered": "Lovecast Ep. 148"
        },
        "content": {
            "rendered": "<ol>\n<li>Stefano Ritter – The Party Life</li>\n<li>Adri Block – That Summer Groove</li>\n<li>Me and My Toothbrush – Gold Member</li>\n<li>Angello Ferreri – Love You</li>\n<li>Hey Jack – OneTime</li>\n<li>Ramit, Angello Ferreri – Old Toys</li>\n<li>Luca Debonaire – Dance</li>\n<li>Angello Ferreri – I’ll Be Good</li>\n<li>Serial Thrilla – Fresh To Def</li>\n<li>Funkstar – Make Me Wanna</li>\n<li>Scrubfish – Blue Eyes</li>\n<li>El Mundo and Satori and Kid Culture – Gotta Help</li>\n<li>Angello Ferreri – So Hard</li>\n<li>Dancing Lovers – Unknown</li>\n<li>Harry Romero featuring Jessica Eve – Rude</li>\n<li>Zenbi, Love &amp; Logic featuring Born – Rebirth Of Slick</li>\n<li>Unknown – On The Block</li>\n<li>Funky Enough – Teabagging</li>\n<li>Fleetwood Smack – Shake It Momma</li>\n<li>Dj Dan &amp; Rudy Funkhauser – Only One Thing To Do</li>\n<li>Proxy Brown – Around</li>\n<li>Hazzarro – Funky Gang</li>\n</ol>\n",
            "protected": false
        },
        "excerpt": {
            "rendered": "<p>Stefano Ritter – The Party Life Adri Block – That Summer Groove Me and My Toothbrush – Gold Member Angello Ferreri – Love You Hey Jack – OneTime Ramit, Angello Ferreri – Old Toys Luca Debonaire – Dance Angello Ferreri – I’ll Be Good Serial Thrilla – Fresh To Def Funkstar – Make Me Wanna [&hellip;]</p>\n",
            "protected": false
        },
